import {BrowserRouter,Routes,Route} from "react-router-dom"
import Form from "./Components/Form";
function App() {
  return (
    <>
    <BrowserRouter>
    <Routes>
      <Route path="/form" element={<Form />}/>


    </Routes>
    </BrowserRouter>
    </>
  );
}

export default App;
